import React from 'react';
import FolderList from './components/FolderList';
import ConversationList from './components/ConversationList';
import SearchBar from './components/SearchBar';

const App = () => {
    return (
        <div>
            <h1>WhatsOrganizer</h1>
            <SearchBar />
            <FolderList />
            <ConversationList />
        </div>
    );
};

export default App;
